eval("module.exports = JSON.parse(\"{\\\"title\\\":\\\"服務\\\",\\\"description\\\":[\\\"卡克曼圍繞在軟體開發團隊的議題上，提供軟體開發、異業合作、團隊建置、職涯發展等相關的服務，除了常規的「開發」與「顧問」委託形式之外，卡克曼主要協助具有特殊需求的客戶，致力於處理常態公司不太會承接的委託，因此卡克曼的合作形式不拘，收費方式也不拘，歡迎苦於找不到資源協助的客戶，來找卡克曼進行諮商。\\\"],\\\"service\\\":{\\\"software\\\":{\\\"title\\\":\\\"軟體開發\\\",\\\"description\\\":[\\\"卡克曼接觸過許多產業，除了一般的前台網站與後台管理系統開發，從Logo設計、UI/UX設計、功能設計、網頁開發到伺服器開發，與一般開發承包商不同，卡克曼能夠深入產業的業務邏輯，與客戶進行對談跟開發設計，高度的質量與客製化開發服務，非常適合有特殊開發需求或條件的客戶。\\\",\\\"如果您認為市面上的服務，無法適切地滿足您的軟體開發需求，卡克曼能夠為您服務；如果您對網站或管理系統開發沒有想法，卡克曼還是能夠為您服務，透過諮商的方式，解析您的需求，幫您構想適合的解決方案；如果您熟知開發，並且希望降低開發的套件依賴度，卡克曼有自行開發套件的經驗，可為您的產品做客製化開發。\\\"],\\\"target\\\":\\\"有客製化開發需求、想要降低對第三方套件依賴的開發需求之客戶\\\"},\\\"collaborative\\\":{\\\"title\\\":\\\"異業合作\\\",\\\"description\\\":[\\\"卡克曼喜歡接觸不同類型、領域、產業，或者有難度的開發設計，也許會超出卡克曼的專業能力之外，仍想要找卡克曼一起合作，合作形式不拘，只要是卡克曼能夠提供的協助，都非常歡迎聯絡洽談。\\\"],\\\"target\\\":\\\"想要異業合作之客戶\\\"},\\\"team\\\":{\\\"title\\\":\\\"團隊建置\\\",\\\"description\\\":[\\\"圍繞在開發團隊上，卡克曼不僅喜歡開發，更熱愛解決團隊相關的問題，從團隊經營、招募策略、教育訓練、開發決策，卡克曼都能以顧問的形式，提供協助。\\\"],\\\"target\\\":\\\"新創團隊、團隊建置、招募、教育訓練、管理...等生手\\\"},\\\"career\\\":{\\\"title\\\":\\\"職涯發展\\\",\\\"description\\\":[\\\"卡克曼喜歡協助別人，讓他們變得更專業，而對於正在自我探索職涯規劃，並想要了解軟體開發的人，或者工作上與軟體開發相關，為了更有效地溝通的人。來喝杯咖啡吧！卡克曼樂意分享想法跟經驗。\\\"],\\\"target\\\":\\\"處於職涯自我探索階段、專案管理、團隊管理、人力資源相關、設計相關、開發人員相關...等人士。\\\"}},\\\"target\\\":\\\"主要服務對象：\\\"}\");//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,eyJ2ZXJzaW9uIjozLCJzb3VyY2VzIjpbXSwibmFtZXMiOltdLCJtYXBwaW5ncyI6IiIsImZpbGUiOiIuL2xhbmd1YWdlcy96aC9zZXJ2aWNlLmpzb24uanMiLCJzb3VyY2VSb290IjoiIn0=\n//# sourceURL=webpack-internal:///./languages/zh/service.json\n");

